        /* Create worksheet from HTML DOM TABLE */

        /* Export to file (start a download) */
        XLSX.writeFile(wb, "SheetJSTable.xlsx");
        });
        
        function constructHeader(headArray){
            let heads = "";
            headArray.forEach(r => {
                heads += `<th scope="col">${r}</th>`;
            });
            return `<thead>
                        <tr>
                            ${heads}
                        </tr>
                    </thead>`;
        }
        function constructBody(headings, doctor, data){
            let body = "";
            let total = 0;
            data.forEach(r => {
                body += '<tr>';
                headings.forEach(h => {
                    body += `<td>${r[h]}</td>`;
                });
                body += '</tr>';
                total += isNaN(r["REF"]) ? 0 : parseFloat(r["REF"]);
            });
            body += `<tr class="border-dashed"><th colspan="7">${doctor} Total</th><th>${total}</th></tr><tr><td colspan="8"></td></tr>`;
            return body;
        }
